import React from 'react'
import styled from 'styled-components'
import SocialBG from '../assets/CommunityBG.webp'
import Ecosystem from '../assets/ecosystem.webp'

const Container = styled.section`
    padding: 6em;
    padding-right: 9em;

    &:before{
        background: url(${SocialBG}) no-repeat;
        background-size: 40%;
        background-position: right;
        content: "";
        height: 100%;
        left: -5%;
        position: absolute;
        top: 40%;
        right: 20%;
        width: 100%;
        z-index: -1;
    }
`

const Ctn = styled.div`
    padding-top: 8em;
    margin-bottom: 10em;

    h1{
        font-size: 7em;
        line-height: 1;
        font-family: "Ruberoid";
        margin: 0;
        padding: 0;
        margin-top: 1.8em;
    }

    p{
        font-family: "Ruberoid";
        font-weight: 500;
        width: 25em;
        font-size: 1.1em;
    }
`

function Social() {
  return (
    <Container>
        <Ctn>
            <h1>Celestia Community</h1>
            <p>Discover community hubs, discussion forums, and resources that are used by the global Celestia community.</p>
        </Ctn>
        <div>
            <div>
                <h2>Social channels</h2>
                <p>Communication channels for the community, discussions, updates, and news.</p>
            </div>

            <div>

            </div>
        </div>   
        <div>
            <div>

            </div>
            <div>
                <h2>Explore</h2>
                <p>Keep up with new resources and content.</p>
            </div>
        </div>  
        <div>
            <img src={Ecosystem} alt='Ecosystem'/>
            <div>
                <h2>Ecosystem</h2>
                <p>Discover a wide range of apps and services built in the Celestia ecosystem.</p>
                <button>Dive in</button>
            </div>
        </div>   
    </Container>
  )
}

export default Social
